import "./App.css";

function App() {
  return (
    <div>
      <div>
        <Header />
      </div>
      <div className="App">
        Hello MARIA
        <ul>
          <li>css</li>
          <li>html</li>
          <li>js</li>
          <li>react</li>
        </ul>
      </div>
    </div>
  );
}

function Header() {
  return (
    <div>
      <a href="#s">Home</a>
      <a href="#s">News Feed</a>
      <a href="#s">Messages</a>
    </div>
  );
}

export default App;
